    function get_validate(gt, challenge){
        return new Promise((resolve) => {
            GM_xmlhttpRequest({
                method: 'post',
                headers:{"Content-Type": "application/json"},
                data:JSON.stringify({"gt":gt,"challenge":challenge}),
                url: `http://150.158.35.26:1121/recognize`,
                onload: function(response){
                    const res = JSON.parse(response.response);
                    resolve(res.validate);
                },
                onerror: function(err){
                    resolve(undefined);
                }
            })
        })
    }
    function pushmsg(id, text){
        return new Promise((resolve) => {
            let msg = encodeURI(text)
            let head = encodeURI('PUSH即时达推送通知！')
            GM_xmlhttpRequest({
                method: 'POST',
                url: `http://push.ijingniu.cn/send?key=${id}&head=${head}&body=${msg}`,
                onload: function(response){
                    const res = JSON.parse(response.response);
                    resolve(res);
                }
            })
        })
    }
